        private static readonly TotalChainParser chainsParser = TotalChainParser.BuildParser(0);
        public static readonly string Pattern = $"^ST 29:1;O;S\\s*(?<sn>{chainsParser.Pattern})$";
        private static readonly Regex pattern = new Regex(Pattern, RegexOptions.Compiled);

        private static readonly double Skelton = new[]
        {
            MassDiffDictionary.CarbonMass * 29,
            MassDiffDictionary.HydrogenMass * 50,
            MassDiffDictionary.OxygenMass * 4,
            MassDiffDictionary.NitrogenMass * 0,
            MassDiffDictionary.PhosphorusMass * 0,
            MassDiffDictionary.SulfurMass * 1,
        }.Sum();

        public ILipid Parse(string lipidStr) {
            var match = pattern.Match(lipidStr);
            if (match.Success) {
                var group = match.Groups;
                var chains = chainsParser.Parse(group["sn"].Value);
                return new Lipid(LbmClass.SSulfate, Skelton + chains.Mass, chains);
            }
            return null;
        }
	}

